class TrieNode:
    def __init__(self, letter):
        self.letter = letter
        self.children = {}
        self.is_end = False


class Trie:
    def __init__(self):
        self.root = TrieNode(None)

    def insert(self, word: str) -> None:
        cur_node = self.root

        for c in word:
            if c in cur_node.children:
                cur_node = cur_node.children[c]
            else:
                cur_node.children[c] = TrieNode(c)
                cur_node = cur_node.children[c]

        # marking end of word
        cur_node.is_end = True

    def search(self, word: str) -> bool:
        cur_node = self.root

        for letter in word:
            if letter in cur_node.children:
                cur_node = cur_node.children[letter]
            else:
                return False

        return cur_node.is_end

    def startsWith(self, prefix: str) -> bool:
        cur_node = self.root

        for letter in prefix:
            if letter in cur_node.children:
                cur_node = cur_node.children[letter]
            else:
                return False

        return True


